import React from "react";
import { Container, Row, Col, Card, CardHeader, CardBody } from "reactstrap";
import Accordion from "../common/accordion/accordion.js";

class Profile extends React.Component {
  state = {};
  toggleModal = state => {
    this.setState({
      [state]: !this.state[state]
    });
  };

  render() {
    return (
      <section className="section">
        <Container>
          <div className="landing-position-relative">
            <section className="section pt-0 pb-200">
              <Row>
                <Col lg="4">
                    <Card className="card-profile shadow mt-5">
                    <CardHeader>بدهکاری</CardHeader>
                    <CardBody></CardBody>
                  </Card>
                </Col>
                <Col lg="4">
                    <Card className="card-profile shadow mt-5">
                    <CardHeader>طلبکاری</CardHeader>
                    <CardBody></CardBody>
                  </Card>
                </Col>
                <Col lg="4">
                    <Card className="card-profile shadow mt-5">
                    <CardHeader>وضعیت کلی</CardHeader>
                    <CardBody></CardBody>
                  </Card>
                </Col>
              </Row>
            </section>
          </div>
        </Container>
      </section>
    );
  }
}

export default Profile;
